import React from "react";
import Header from "./components/header";
import Body from "./components/body";
import Footer from "./components/footer";

export default function App(){

    return (
      <React.Component>
        <Header />
        <Body />
        <Footer createContact={this.createContact} />
      </React.Component>
    );

}
